import './App.css';

function App() {
  return (
    <>
      <div className="wrapper">
        <header className="header">
          <div className="header__logo" />
        </header>
        <main className="content">
          <section class="profile">

          </section>
        </main>
      </div>
    </>
  );
}

export default App;
